#navigation .c,
#navigation .c1,
#navigation .c2,
#navigation .c3,
#navigation .c *,
#location .c,
#location .c1,
#location .c2,
#location .c3 {
  background-color: transparent !important;
  border-color: #011d41 !important;
}

#navigation { background: #405882 url("data:image/gif;base64,R0lGODlhAQAKAJEAAFBmjVRqkGd9oQAAACH5BAAAAAAALAAAAAABAAoAAAIEhIAJUQA7") top left repeat-x !important; }

#navigation li { border-color: #677da1 !important; }

#navigation ul ul {
  border-color: #677da1 !important;
  border-top: 3px solid #405882 !important;
}

#location, #location .c * {background-color: #50668d !important}

#navigation .c1, #location .c1 {margin: 0 0px !important; border-width: 0 2px !important}

.maintable tr { background-color: #fff !important; color: #000 !important}
.maintable tr.d { background-color: #f0f1f2 !important; }

a:link { color: #82BDFF !important; }
a:visited { color: #72ADDF !important; }
a:active { color: #92CDFF !important; }

h2 > a:link,
h2 > a:visited,
h2 > a:active,
a.rss {color: #fff !important}

tr td a:link,
tr td a:visited,
tr td a:active,
th a:link,
th a:visited,
th a:active,
li a:link,
#searchsuggestions a:link,
#searchsuggestions a:visited,
#searchsuggestions a:active,
#navigation ul ul li a:link,
#navigation ul ul li a:visited,
#navigation ul ul li a:active {color: #000 !important}

#navigation ul li a:link,
#navigation ul li a:visited,
#navigation ul li a:active,
#location li {color: #fff !important}

#location a:link,
#location a:visited,
#location a:active {color: #82BDFF !important}

#downloadbox {
background-color: #415983 !important;
border: 1px solid #50668d !important;
}

#torrentgeneral p.left, #footer, #footer .left, #tabs {
border-color: #50668d !important;
}

hr {color: #50668d !important;}

#tabs a {
color: #fff !important;
background-color: #415983 !important;
border: 1px solid #50668d !important;
}

#tabs .current a {
color: #000 !important;
background-color: #fff !important;
}

#tabs a:hover { background-color: #50668d !important; }

#pagination a {
color: #fff !important;
border-color: #50668d !important;
}

#pagination a:hover {
color: #fff !important;
border-color: #50668d !important;
background-color: #50668d !important;
}

p#altdownload, #banner-toolbar { display: none !important; }

